#include<bits/stdc++.h>
using namespace std;
class Solution {
public:
    int maxProduct(vector<int>& nums) {
        if(nums.size()==1) return nums.at(0);
        int result=*max_element(nums.begin(),nums.end());
        int minVal=1,maxVal=1;
        for(int i=0;i<nums.size();i++){
            if(nums.at(i)==0){
                minVal=1;
                maxVal=1;
                continue;
            }
            int temp=maxVal*nums.at(i);
            maxVal=max(maxVal*nums.at(i),max(minVal*nums.at(i),nums.at(i)));
            minVal=min<int>(temp,min<int>(minVal*nums.at(i),nums.at(i)));
            result=max(result,maxVal);
        }
        return result;
    }
};
